import "@babel/polyfill";
import "mutationobserver-shim";
import Vue from "vue";
import App from "./App.vue";
import router from "./router";
import AOS from "aos";
import "./assets/tailwind.css";
import "aos/dist/aos.css";

new Vue({
  created() {
    AOS.init();
  },
  render: (h) => h(App),
})
  .use(router)
  .mount("#app");
